INSERT INTO `questions` VALUES (1,1,4,'テストテスト','スタイリストをご家族やご友人におすすめしますか？','level',NULL,'理由',1,10,'いいえ','はい',1,0,'2019-06-02 19:53:11','2022-01-15 11:43:31'),(2,1,5,'テストテスト','本日ご来店時に、担当者から歓迎されていると感じましたか。','level',NULL,NULL,1,5,'いいえ','はい',NULL,0,'2019-06-02 19:55:58','2022-01-15 11:43:31'),(3,1,6,'テストテスト','本日の希望するスタイルについて、適切なコミュニケーションがおこなえましたか。','level',NULL,NULL,1,5,'いいえ','はい',NULL,0,'2019-06-02 19:58:09','2022-01-15 11:43:31'),(4,1,7,'テストテスト','スタイルやケアについて提案や情報提供はありましたか。','level',NULL,NULL,1,5,'いいえ','はい',NULL,0,'2019-06-02 19:59:11','2022-01-15 11:43:31'),(5,1,8,'テストテスト','仕上がりはイメージ通りでしたか。','level',NULL,NULL,1,5,'いいえ','はい',NULL,0,'2019-06-02 20:01:12','2022-01-15 11:43:31'),(6,1,9,'テストテスト','ヘアスタイル以外についての会話はありましたか。','level',NULL,NULL,1,5,'いいえ','はい',NULL,0,'2019-06-02 20:01:49','2022-01-15 11:43:31'),(7,1,10,'テストテスト','言葉にしていないことや、伝えにくいことを察してくれましたか。','level',NULL,NULL,1,5,'いいえ','はい',NULL,0,'2019-06-02 20:02:30','2022-01-15 11:43:31'),(8,1,1,'テストテスト','あなたの性別を教えてください。','select_one','[{\"label\":\"\\u5973\\u6027\",\"value\":\"\\u5973\\u6027\",\"default\":false},{\"label\":\"\\u7537\\u6027\",\"value\":\"\\u7537\\u6027\",\"default\":false},{\"label\":\"\\u7121\\u56de\\u7b54\",\"value\":\"\\u7121\\u56de\\u7b54\",\"default\":true}]',NULL,1,5,NULL,NULL,NULL,0,'2019-09-09 19:10:01','2022-01-15 11:43:31'),(9,1,2,'テストテスト','あなたの年齢を教えてください。','select_one','[{\"label\":\"19\\u6b73\\u4ee5\\u4e0b\",\"value\":\"19\\u6b73\\u4ee5\\u4e0b\",\"default\":false},{\"label\":\"20\\u6b73\\u301c29\\u6b73\",\"value\":\"20\\u6b73\\u301c29\\u6b73\",\"default\":false},{\"label\":\"30\\u6b73\\u301c39\\u6b73\",\"value\":\"30\\u6b73\\u301c39\\u6b73\",\"default\":false},{\"label\":\"40\\u6b73\\u301c49\\u6b73\",\"value\":\"40\\u6b73\\u301c49\\u6b73\",\"default\":false},{\"label\":\"50\\u6b73\\u301c59\\u6b73\",\"value\":\"50\\u6b73\\u301c59\\u6b73\",\"default\":false},{\"label\":\"60\\u6b73\\u301c69\\u6b73\",\"value\":\"60\\u6b73\\u301c69\\u6b73\",\"default\":false},{\"label\":\"70\\u6b73\\u4ee5\\u4e0a\",\"va